import types from '../types';

export const getResultsStart = () => ({
    type: types.SET_QUERY_START,
});

export const getResultsSuccess = (data) => ({
    type: types.SET_QUERY_SUCCESS,
    data,
});

export const getResultsFail = (error) => ({
    type: types.SET_QUERY_FAIL,
    error,
});
